import { GerencialLayout } from "../../../components";

function UsersListPage() {
  return (
    <GerencialLayout>
      <div className="flex flex-row items-center justify-between">
        <h2 className="text-4xl font-semibold">User Management</h2>
        <button type="button" className="bg-green-500 text-white">New User</button>
      </div>
    </GerencialLayout>
  );
};

export default UsersListPage;
